import ChatBot from "./components/ChatBot";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <div className="d-flex">
      <div className="row">
        <h1>Your Personal Trainer</h1>
      </div>
      <div className="row">
        <div className="col-4" style={{height: "300px", background: "white"}}>
        <ChatBot />
        </div>
      </div>

    </div>
  );
}

export default App;
